import { useState, useEffect } from "react";

const url = "http://localhost:3001/";

function Users() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const res = await fetch(url);
      const data = await res.json();
      setUsers(data);
    }
    fetchData();
  }, []);

  console.log(users);

  return (
    <div>
      <h1>{users[0].nome}</h1>
    </div>
  );
}

export default Users;
